import React from "react";
import Heading from "./Heading.jsx";
import Table from "./Table";
import Parah from "./Parah";
import Message from "./Message";
import {Add, Sub, Mul, Div} from "./calculator";

function App() {
    return (
        <>
            <Heading />
            <Table />
            <Parah />
            <Heading />
            <Message />
            <ul>
                <li> Sum is : {Add(20, 10)}</li>
                <li> Subtraction is : {Sub(40, 15)}</li>
                <li> Multipulication is : {Mul(10, 5)}</li>
                <li> Division is : {Div(37, 3)}</li>
            </ul>
        </>
    );
}

export default App;
